import NotFound from "../components/NotFoundPage/NotFound";
import HomePage from "../pages/HomePage/HomePage";
import OrderPage from "../pages/OrderPage/OrderPage";
import ProductPage from "../pages/ProductPage/ProductPage";

export const routes = [
    {
        path: '/',
        page:HomePage,
        isShow
    },
    {
        path: '/orders',
        page:OrderPage
    },
    {
        path: '/products',
        page:ProductPage
    },
    {
        path: '*',
        page:NotFound
    }
]
